import React from 'react';
import { clientId } from './clientId';

class GoogleAuth extends React.Component {
  componentDidMount() {
    window.gapi.load('client', () => {
      window.gapi.client.init({
        clientId: clientId,
        scope: 'email'
      })
    })
  }
  render() {
    return (
      <div>google</div>
    )
  }
}

export default GoogleAuth;
